import React, { useState } from "react";
import {document} from "../assets/icons";

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div className="container-fluid">
      <div className="row">
          <div className="col login-col">
              <svg src={document} className="icon-color-white" height={100} width={100}/>
            <h2>Login</h2>
            <input className="login-input-fields" type="text" placeholder="email"/><br/>
            <input className="login-input-fields" type="password" placeholder="password"/>
          </div>
      </div>
    </div>
  );
}

export default Login;
